  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `login` varchar(150) NOT NULL,
  `title` varchar(150) DEFAULT NULL,
  `description` varchar(1024) DEFAULT NULL,
  `link` varchar(150) DEFAULT NULL,
